import { BrowserRouter as Router } from "react-router-dom";
import LoginPage from "./Pages/LoginPage";
import ProfDashBoard from "./Pages/ProfDashboard";





export const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
             <Link to = "/">LoginPage</Link>
            </li>
            <li>
              <Link to="/ProfDashBoard">ProfDashBoard</Link>
            </li>
          </ul>
        </nav>
      </div>

      </Router>
  );
}

export default App
